      <Link to={`/Cafedetailspage/${id}`}>
         <div className='cafeCard'>
             <img src={imageUrl} alt="" width="100%" height="40%" />
             <div>

             </div>
           
             {/* <p>{payment_methods}</p> */}
         </div>
      </Link>
    
  )
}

export default CafeCard
